export const Svgbox = (props) => {
  const { list = null, size = 'sm', color = 'dark', rowid = 0 } = props;

  const onClick = (eid, e) => {
    props.onClick && props.onClick(eid, rowid, e);
  };

  return <StyledSvgbox className={cx('svg-box', props.className)}>
    {props.children ? props.children : list.map((item, index) =>
      <Svg key={index} className={size} icon={item.icon} color={color} eid={item.eid ? item.eid : item.icon} disabled={item.disabled} onClick={onClick} />
    )}
  </StyledSvgbox>;
};

