export const Svglist = (props) => {
  const [show, setShow] = useState(props.show || false);
  const { className, size = 'lg' } = props;

  const onClick = (eid, e) => {
    setShow(eid !== 'show');
    // (eid === "show") ? : setShow("show");
  };

  var list = [];
  Object.keys(svg).map(key => list.push(svg[key]));

  return (
    <SvgListStyle className={cx('svg-list', className, size)}>
      <Svg className={'btn-svg-show md'} icon={show ? 'hide' : 'show'} color={'black'} eid={show ? 'show' : 'hide'} onClick={onClick} />
      {show && <div className={cx('sl-frame')}>
        {list.map((item, index) => {
          return <span key={index} className={'svg-item'}>
            <Svg className={size} icon={item.name} />
            <span className={'svg-name'}>{item.name}</span>
          </span>;
        })}
      </div>}
    </SvgListStyle >
  );
};
